// import './App.css';
import School from './components/School'
// import App from './components/schoolcard/App';

function createCard(Contacts) {
  return (
    <Card
      key={Contacts.id}
      name={Contacts.name}
      img={Contacts.imgURL}
      fees = {Contacts.fees}
      type = {Contacts.type}
      board = {Contacts.board}
      grade= {Contacts.grade}
      add = {Contacts.address}
    />
  );
}

function App1() {
  return (
    <div>
      <h1 className="heading">School List</h1>
      {Contacts.map(createCard)};
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <School></School>

       {/* <SchoolDetails></SchoolDetails> */}
       {/* <College></College> */}
       {/* <App></App> */}
      </header>
    </div>
  );
}

export default App;
